import React, {useState, useEffect} from 'react';
import styles from '../styles/AboutUs.module.scss';
import classes from '../styles/AboutUs.module.scss';

const About = () => {
  const [isLoaded, setIsLoaded] = useState(false);

  useEffect(() => {
    setTimeout(() => {
      setIsLoaded(true);
    }, 500);
  }, []);

  return (
    <div>
      <h1>About Us</h1>
    </div>
  );
};

export default About;
